const BlogList = (props) => {
    const blogs = props.blogs;
    const title= props.title;
    return ( 
        <div className="blog-title">
        {
            blogs.map((blog)=>(
                <div className="blog-preview">
                    <h2>{blog.title}</h2>
                    <p>{blog.author}</p>
                </div>
            ))
        }
        </div>
     );
}
 
export default BlogList;
